      SELECT ALL CAST ( - col0 AS INTEGER ) AS col1 FROM tab0 WHERE 66 * 14 NOT IN ( - + CAST ( - + col2 AS INTEGER ), - col0 * + col1 + + 6, col2 + - - ( - CAST ( col0 AS INTEGER ) ) );
  - name: tab0

outputs:
  - name: q10308.out
    data: |
      -15
      -87
      -97
